import UilReact from '@iconscout/react-unicons/icons/uil-react'
import { Link, NavLink } from 'react-router-dom';
import './Header.css';

const Header = () => {
    return (
        <header>
        <div class="nav-bar">
            <Link href="" class="logo">Logo</Link>
            <div class="navigation">
                <div class="nav-items">
                    <i class="uil uil-times nav-close-btn"></i>
                    <Link href=""><UilReact class="uil"></UilReact> Explore</Link>
                    <Link href=""><i class="uil uil-info-circle"></i> About us</Link>
                    <Link href="/index.html"><i class="uil uil-home"></i> Home</Link>
                    <Link href=""><i class="uil uil-document-layout-left"></i> Blog</Link>
                    <Link href=""><i class="uil uil-envelope"></i> Contact</Link>


                </div>
            </div>
            <i class="uil uil-apps nav-menu-btn"></i>
        </div>
    </header>
    );
};

export default Header;
